tables.table_schema:
CREATE TABLE QuantumSystemParameters (
  id SERIAL PRIMARY KEY,
  parameter_name VARCHAR(255) NOT NULL,
  parameter_value VARCHAR(255) NOT NULL,
  optimization_level INT NOT NULL
);

CREATE TABLE Quantum_System_Optimization_Parameters (
  id SERIAL PRIMARY KEY,
  parameter_name TEXT NOT NULL,
  parameter_value FLOAT NOT NULL
);

CREATE TABLE Quantum_System_Optimization_History (
  id SERIAL PRIMARY KEY,
  optimization_date DATE NOT NULL,
  optimization_result TEXT
);

CREATE TABLE quantum_system_parameters (
  parameter_id UUID PRIMARY KEY,
  system_id UUID,
  parameter_name TEXT,
  parameter_value FLOAT
);

CREATE TABLE quantum_systems (
  system_id UUID PRIMARY KEY,
  system_name TEXT,
  system_type TEXT
);

CREATE TABLE optimization_parameters (
  parameter_id UUID PRIMARY KEY,
  optimization_id UUID,
  optimization_name TEXT,
  optimization_value FLOAT
);

CREATE TABLE OptimizationParameters (
    parameter_id UUID PRIMARY KEY,
    parameter_name STRING,
    parameter_value FLOAT
);

CREATE TABLE OptimizationConfigurations (
    config_id UUID PRIMARY KEY,
    config_name STRING,
    config_description STRING
);

CREATE TABLE QuantumCircuits (
    circuit_id UUID PRIMARY KEY,
    circuit_name STRING,
    circuit_description STRING
);

CREATE TABLE QuantumResults (
    result_id UUID PRIMARY KEY,
    result_name STRING,
    result_value FLOAT,
    result_description STRING
);

CREATE TABLE QuantumSystemOptimizationParameters (
    optimization_id INT PRIMARY KEY,
    parameter_name VARCHAR(50),
    parameter_value FLOAT
);

CREATE TABLE QuantumSystemConfigurations (
    config_id INT PRIMARY KEY,
    system_name VARCHAR(50),
    hardware_configuration VARCHAR(100),
    software_configuration VARCHAR(100)
);

CREATE TABLE QuantumSystemResults (
    result_id INT PRIMARY KEY,
    optimization_id INT,
    result_value FLOAT,
    iteration_count INT
);

CREATE TABLE QuantumSystemUsers (
    user_id INT PRIMARY KEY,
    username VARCHAR(50),
    email VARCHAR(100),
    password VARCHAR(50)
);

CREATE TABLE QuantumSystemLogs (
    log_id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    log_message TEXT
);
